    "2015-06-19T15:47:32.330239",nt"name": "base-map-submission-for-wilkin-county-minnesota",nt"isopen":
    false,nt"url": null,nt"notes": "FEMA Framework Basemap datasets comprise
    six of the seven FGDC themes of geospatial data that are used by most GIS applications
    (Note: the seventh framework theme, orthographic imagery, is packaged in a separate
    NFIP Metadata Profile): cadastral, geodetic control, governmental unit, transportation,
    general structures, hydrography (water areas &amp; lines. These data include an
    encoding of the geographic extent of the features and a minimal number of attributes
    needed to identify and describe the features. (Source: Circular A16, p. 13) This
    data set contains 3-band natural color imagery from the National Agricultural Imagery
    Program (NAIP). NAIP acquires digital ortho imagery during the agricultural growing
    seasons in the continental U.S. A primary goal of the NAIP program is to enable
    availability of ortho imagery within one year of acquisition. The source files are
    1 meter ground sample distance (GSD) ortho imagery rectified to a horizontal accuracy
    of within +/- 5 meters of reference digital ortho quarter quads (DOQQ's) from the
    National Digital Ortho Program (NDOP) or from NAIP. The tiling format of NAIP imagery
    is based on a 3.75' x 3.75' quarter quadrangle with a 300 meter buffer on all four
    sides. NAIP imagery is formatted to the UTM coordinate system using NAD83. NAIP
    imagery may contain as much as 10% cloud cover per tile. This file was generated
    by compressing NAIP imagery that cover the county extent. MrSID compression was
    used. Target values for the compression ratio are (15:1). (Note: The Minnesota Geospatial
    Information Office (MnGeo) has created this metadata record to describe the entire
    NAIP2009 dataset, using information from Farm Service Agency metadata. Each county
    file is accompanied by the original FSA metadata for that county.)",nt"license_title":
